Terapeuta Holística, facilitadora de workshops ( Reativação do Maná e De volta pra casa) e palestrante.
As sessões que realizo hoje é um conjunto de técnicas (Frequências de Brilho, Barras de Access, Método Melchizedeck e Voronandeck, Reiki, etc...), atuando dentro de dimensões e frequências mais elevadas (5, 6, 7...).

Para cada pessoa que vem até mim, um pouco de cada técnica é utilizada, assim como os seres que se apresentam na hora.

Pode ser presencial ou a distância, onde é acessado um espaço multidimensional amoroso e seguro para que você possa iniciar sua jornada.

Benefícios:

- Liberação de crenças;
- Realinhamento físico, energético e espiritual; 
- Retirada de miasmas e energias de controle;
- Reprogramação do DNA;
- Auxilia em doenças físicas e emocionais; 
- Ativação da Chama Trina;
- Ativações de portais trazendo mais saúde, consciência, abundância, criatividade e alegria para a sua vida.

